(window.webpackJsonpsmartcharts=window.webpackJsonpsmartcharts||[]).push([[13],{316:function(e){e.exports=JSON.parse('{"[symbol] feed is delayed by [delay] minutes":"[symbol] แสดงข้อมูลล่าช้า [delay] นาที","[symbol] market is now opened.":"[symbol] ขณะนี้ ตลาดเปิดทำการแล้ว","[symbol] market is presently closed.":"[symbol] ขณะนี้ ตลาดได้ปิดทำการ","A technical momentum indicator that compares a security\'s closing price to its price range over a given time period. The oscillator\'s sensitivity to market movements can be reduced by adjusting the time period or by taking a moving average of the result.":"ดัชนีโมเมนตัมเชิงเทคนิคที่เปรียบเทียบราคาปิดของหลักทรัพย์กับขอบเขตของราคาในช่วงเวลาที่กำหนด สามารถลดการตอบสนองของตัวแกว่งต่อการเคลื่อนไหวของตลาดได้โดยการปรับช่วงระยะเวลา หรือด้วยการใช้ผลลัพธ์ของค่าเฉลี่ยเคลื่อนที่","Active":"ใช้งานอยู่","Add":"เพิ่ม","Add new template":"เพิ่มเทมเพลตใหม่","Add new templates":"เพิ่มเทมเพลตใหม่","All drawings":"ภาพวาดทั้งหมด","already exists.":"มีอยู่แล้ว","Area":"พื้นที่","Available only for \\\\\\"Area\\\\\\" chart type.":"ใช้ได้เฉพาะกับ \\\\\\"พื้นที่\\\\\\" แบบแผนภูมิเท่านั้น","Available only for non-tick time intervals.":"ใช้ได้เฉพาะช่วงเวลา non-tick เท่านั้น","Bill Williams introduced the Alligator indicator in 1995. The Alligator is as much a metaphor as it is an indicator. It consists of three lines, overlaid on a pricing chart, that represent the jaw, the teeth and the lips of the beast, and was created to help the trader confirm the presence of a trend and its direction. The Alligator indicator can also help traders designate impulse and corrective wave formations, but the tool works best when combined with a momentum indicator.":"Bill Williams เปิดตัว Alligator indicator ในปี 1995 Alligator เปรียบเสมือนตัวบ่งชี้ ที่ประกอบด้วยเส้นสามเส้นซ้อนทับบนแผนภูมิราคาซึ่งแสดงถึงกรามฟัน และริมฝีปากของสัตว์ร้าย ถูกสร้างขึ้นเพื่อช่วยให้ผู้ซื้อขายยืนยันการมีอยู่ของแนวโน้ม และทิศทางของมัน นอกจากนี้ตัวบ่งชี้ Alligator ยังช่วยให้ผู้ซื้อขายระบุแรงกระตุ้น และการก่อตัวของคลื่นที่ถูกต้อง แต่เครื่องมือนี้จะทำงานได้ดีที่สุดเมื่อรวมกับตัวบ่งชี้โมเมนตัม","Bollinger Bands can be used to measure the highness or lowness of the price relative to previous trades.":"สามารถใช้ Bollinger Bands เพื่อวัดความสูงหรือต่ำของราคาเปรียบเทียบกับการซื้อขายก่อนหน้านี้","Box Size":"ขนาดกล่อง","Cancel":"ยกเลิก","Candle":"แท่งเทียน","Channel [num]":"ช่อง [num]","Chart data is not available for this symbol.":"ไม่มีข้อมูลแผนภูมิสำหรับสัญลักษณ์นี้","Chart types":"ชนิดแผนภูมิ","Charts":"แผนภูมิ","Clear all":"ล้างทั้งหมด","CLOSED":"ปิดแล้ว","Color":"สี","Continuous":"ต่อเนื่อง","Continuous [num]":"ดำเนินการต่อ [num]","CSV":"CSV","Dark":"มืด","day":"วัน","days":"วัน","Developed by Larry Williams, Williams %R is a momentum indicator that is the inverse of the Fast Stochastic Oscillator. Also referred to as %R, Williams %R reflects the level of the close relative to the highest high for the look-back period.":"พัฒนาโดย Larry Williams, Williams %R เป็นตัวบ่งชี้โมเมนตัมที่กลับตัวของ Fast Stochastic Oscillator\\nอย่างรวดเร็ว นอกจากนี้เรียกว่า %R, Williams %R สะท้อนถึงระดับราคาปิดที่สัมพันธ์กับราคาปิดสูงสุดของช่วงเวลาของการมองย้อนกลับ","Developed by Tushar Chande in 1995, Aroon is an indicator system that determines whether a stock is trending or not and how strong the trend is. There are two separate indicators: Aroon-Up and Aroon-Down. A 25-day Aroon-Up measures the number of days since a 25-day high. A 25-day Aroon-Down measures the number of days since a 25-day low.":"พัฒนาโดย Tushar Chande ในปี 1995 Aroon เป็นระบบตัวบ่งชี้ที่กําหนดว่าหุ้นกำลังมีแนวโน้มหรือไม่ และแนวโน้มนั้นแข็งแกร่งเพียงใด มีสองตัวชี้วัดที่แยกต่างหากคือ Aroon-Up และ Aroon-Down ตัว Aroon-Up 25 วัน จะวัดจำนวนวันตั้งแต่ที่ราคาสูง 25 วัน และ Aroon-Down 25 วัน จะวัดจำนวนวันตั้งแต่ที่ราคาต่ำ 25 วัน","Display data for a specific date and time":"แสดงข้อมูลสําหรับวันที่และเวลาที่ระบุ","Display remaining time for each interval":"แสดงเวลาที่เหลือสําหรับแต่ละช่วงเวลา","Display the highest and lowest spot price":"แสดงราคาจุดสูงสุดและจุดต่ำสุด","Done":"แล้วเสร็จ","Download":"ดาวน์โหลด","Drawing tools":"เครื่องมือวาดภาพ","Favorites":"รายการโปรด","Fib Fan [num]":"Fib Fan [num]","Fractals are indicators on candlestick charts that identify reversal points in the market. Traders often use fractals to get an idea about the direction in which the price will develop. A fractal will form when a particular price pattern happens on a chart.":"Fractals เป็นตัวชี้วัดในแผนภูมิแท่งเทียนที่ระบุจุดกลับตัวในตลาด ผู้ซื้อขายมักจะใช้ Fractals เพื่อแสดงทิศทางราคาที่จะเกิดชึ้น โดยจะออกเป็นรูปร่างของรูปแบบราคาที่เกิดขึ้นในแผนภูมิ","H":"H","Highest and lowest spot":"จุดสูงสุดและจุดต่ำสุด","Historical data mode":"โหมดข้อมูลย้อนหลัง","Hollow":"กลวง","Horizontal [num]":"เส้นแนวนอน [num]","hour":"ชั่วโมง","hours":"ชั่วโมง","Indicators":"ดัชนี","Interval duration":"ช่วงเวลา","Kagi":"คากิ","L":"L","Language":"ภาษา","Last digits stats for latest 1000 ticks on":"สถิติตัวเลขหลักสุดท้ายของ 1,000 ticksล่าสุด","Light":"สว่าง","Line [num]":"เส้น [num]","Line Break":"เส้นแบ่งบรรทัด","MACD is a trading indicator used in technical analysis of stock prices. It is supposed to reveal changes in the strength, direction, momentum, and duration of a trend in a stock\'s price.":"MACD เป็นตัวบ่งชี้การซื้อขายที่ใช้ในการวิเคราะห์ทางเทคนิคของราคาหุ้น ซึ่งควรจะเปิดเผยการเปลี่ยนแปลงในความแข็งแกร่ง ทิศทาง โมเมนตัม และระยะเวลาของแนวโน้มของราคาหุ้น","Markets":"ตลาด","minute":"นาที","minutes":"นาที","Momentum":"","Moving averages":"","Network status":"สถานะเครือข่าย","No results for":"ไม่พบผลลัพธ์สําหรับ","OHLC":"OHLC","Opens in:":"เปิดใน:","Others":"","Overwrite":"เขียนทับ","Platform settings":"การตั้งค่าแพลตฟอร์ม","PNG":"PNG","Point & Figure":"จุดและตัวเลข","Price Lines":"เส้นราคา","Range":"ช่วง","Range Bars":"ช่วงบาร์","Ray [num]":"เรย์ [num]","Rectangle [num]":"สี่เหลี่ยมผืนผ้า [num]","Renko":"เรนโก","Reset":"ตั้งค่าใหม่","Result":"ผลลัพธ์","Retrieving Chart Data...":"กำลังโหลดข้อมูลแผนภูมิ","Retrieving Chart Engine...":"กำลังโหลดเครื่องมือแผนภูมิ","Retrieving Market Symbols...":"กำลังโหลดข้อมูลสัญลักษณ์ตลาด","Retrieving Trading Times...":"กำลังโหลดข้อมูลเวลาซื้อขาย","Reversal":"กลับตัว","Reversal Percentage":"ร้อยละของกลับตัว","Right click to delete":"คลิกขวาเพื่อลบ","Right click to manage":"คลิกขวาเพื่อจัดการ","Saved templates":"เทมเพลตที่บันทึกแล้ว","Search...":"ค้นหา","Select language":"เลือกภาษา","Select theme":"เลือกธีม","Settings":"การตั้งค่า","Size":"ขนาด","Streaming for [symbol] is not available due to license restrictions":"การสตรีมสำหรับ [symbol] ไม่พร้อมใช้งาน เนื่องจากข้อจำกัดสิทธิ์การใช้งาน","Templates":"แม่แบบ","The Average Directional Movement Index index (ADX) was developed in 1978 by J. Welles Wilder as an indicator of trend strength in a series of prices of a financial instrument ADX will range between 0 and 100. Generally, ADX readings below 20 indicate trend weakness, and readings above 40 indicate trend strength.":"ดัชนี Average Directional Movement Index (ADX) ถูกพัฒนาขึ้นในปี 1978 โดย J. Welles Wilder เป็นตัวบ่งชี้ของความแข็งแกร่งของแนวโน้มในชุดของราคาของเครื่องมือทางการเงินที่ ADX จะมีช่วงอยู่ระหว่าง 0 ถึง 100 โดยทั่วไป ADX อ่านค่าต่ำกว่า 20 จะบ่งบอกถึงดัชนีแสดงแนวโน้มอ่อนแอ และอ่านค่าสูงกว่า 40 จะบ่งบอกถึงดัชนีที่แสดงความแข็งแกร่งของแนวโน้ม","The Awesome Oscillator is an indicator used to measure market momentum. AO calculates the difference of a 34 Period and 5 Period Simple Moving Averages. The Simple Moving Averages that are used are not calculated using closing price but rather each bar\'s midpoints. AO is generally used to affirm trends or to anticipate possible reversals.":"Awesome Oscillator คือตัวบ่งชี้ที่ใช้เพื่อบอกสภาวะแนวโน้มโมเมนตัมของตลาด AO คำนวณความแตกต่างของ ช่วงเวลา 34 และ 5 ช่วงเส้นค่าเฉลี่ยเคลื่อนที่อย่างง่าย ค่าเฉลี่ยเคลื่อนที่อย่างง่ายที่ใช้จะไม่ได้คำนวณโดยใช้ราคาปิด แต่เป็นจุดกึ่งกลางของแต่ละแท่ง โดยทั่วไป AO จะใช้เพื่อยืนยันแนวโน้ม หรือเพื่อคาดการณ์การกลับตัวที่อาจเกิดขึ้น","The Commodity Channel Index (CCI) is a versatile indicator that can be used to identify a new trend or warn of extreme conditions.":"Commodity Channel Index (CCI) เป็นตัวบ่งชี้ที่หลากหลายที่สามารถใช้บอกแนวโน้มใหม่ หรือการเตือนสภาวะที่รุนแรง","The Detrended Price Oscillator (DPO) helps to identify price cycles without the influence of short- and long-term trends. The DPO compares a simple moving average to a historical pricenear the middle of a specified period. It also shows the peaks and drops over that particular period, making it easier to predict buy points.":"Detrended Price Oscillator (DPO) ช่วยในการระบุรอบราคาโดยไม่มีอิทธิพลของแนวโน้มระยะสั้น และระยะยาว DPO เปรียบเทียบค่าเฉลี่ยเคลื่อนที่อย่างง่ายกับราคาในอดีตช่วงกลางของช่วงเวลาที่กำหนด นอกจากนี้ยังแสดงจุดสูงสุด และช่วงลดลงในช่วงเวลานั้นๆ ทำให้ง่ายต่อการคาดการณ์จุดซื้อ","The Donchian Channel is an indicator used in market trading developed by Richard Donchian. It is formed by taking the highest high and the lowest low of the last n periods. The area between the high and the low is the channel for the period chosen.":"Donchian Channel เป็นตัวบ่งชี้ที่ใช้ในการซื้อขายในตลาดที่พัฒนาโดย Richard Donchian เป็นการแสดงรูปแบบโดยใช้จุดสูงที่สูง และจุดต่ำที่สุดของ n ช่วงสุดท้าย พื้นที่ระหว่างค่าสูงและค่าต่ำเป็นช่องของช่วงเวลาที่เลือก","The Gator Oscillator helps to detect trend changes in the market price. Based on the Alligator indicator, the Gator plots 2 histograms on either side of the zero line. The sleeping phase (absence of a trend) is when the bars on both sides are red. The awakening phase (formation of a trend) is when there are red and green bars on both sides. When there are green bars on both sides, it indicates the eating phase (trend strengthening). A solitary red bar appearing after the eating phase indicates the beginning of the sated phase (trend approaching its end).":"Gator Oscillator ช่วยตรวจจับการเปลี่ยนแปลงแนวโน้มของราคาตลาด จากตัวบ่งชี้ Alligator Gator จะวางแผน 2 ฮิสโตแกรมที่ด้านใดด้านหนึ่งของเส้นศูนย์ ระยะการนอนหลับ (ไม่มีแนวโน้ม) คือเมื่อแถบทั้งสองด้านเป็นสีแดง ระยะการตื่น (การก่อตัวของแนวโน้ม) คือเมื่อมีแถบสีแดง และสีเขียวทั้งสองด้าน เมื่อมีแถบสีเขียวทั้งสองด้าน แสดงถึงระยะการกิน (แนวโน้มการเพิ่มขึ้น) แถบสีแดงโดดเดี่ยวปรากฏขึ้นหลังจากระยะการกิน บ่งบอกถึงจุดเริ่มต้นของระยะ sated (แนวโน้มใกล้สิ้นสุด)","The Ichimoku Cloud, also known as Ichimoku Kinko Hyo, is a versatile indicator that defines support and resistance, identifies trend direction, gauges momentum and provides trading signals. Ichimoku Kinko Hyo translates into “one look equilibrium chart”.":"Ichimoku Cloud หรือที่เรียกกันว่า Ichimoku Kinko Hyo เป็นตัวบ่งชี้อเนกประสงค์ที่ใช้งานได้หลากหลาย กำหนดแนวรับ และแนวต้าน ระบุทิศทางแนวโน้ม เป็นมาตรวัดโมเมนตัม และให้สัญญาณการซื้อขาย Ichimoku Kinko Hyo ได้รับการแปลเป็น “มองไปที่แผนภูมิอย่างสมดุล”","The Moving Average (MA) helps to identify the overall market trend by filtering out short-term price fluctuations. Using historical data, it calculates the average price over a specific period and plots a line on the chart. If the MA line moves upwards, it’s an indicator of an uptrend, a downtrend if it moves downwards. A buy signal occurs when the price moves above the MA line.":"ค่าเฉลี่ยเคลื่อนที่ (MA) ช่วยในการระบุแนวโน้มของตลาดโดยรวมโดยการกรองความผันผวนของราคาระยะสั้น การใช้ข้อมูลในอดีตจะคำนวณราคาเฉลี่ยในช่วงเวลาหนึ่ง และลงจุดเส้นบนแผนภูมิ หากเส้น MA ขยับขึ้นแสดงว่าเป็นแนวโน้มขาขึ้น หากเส้นดังกล่าวเคลื่อนตัวลงถือว่าเป็นขาลง สัญญาณซื้อเกิดขึ้นเมื่อราคาเคลื่อนที่เหนือเส้น MA","The Moving Average Envelope (MAE) helps to identify strong price movement that indicates the start of a trend. The MAE creates a moving average line as well as 2 bands around it. In theory, when the market price touches the upper or lower bands, a trend reversal will occur, indicating a buy signal.":"Moving Average Envelope (MAE) ช่วยระบุการเคลื่อนไหวของราคาที่แข็งแกร่งซึ่งบอกถึงจุดเริ่มต้นของ MAE สร้างเส้นค่าเฉลี่ยเคลื่อนที่เช่นเดียวกับ 2 วงรอบ ตามทฤษฎีเมื่อราคาแตะที่ด้านบนหรือล่าง การกลับตัวของแนวโน้มจะเกิดขึ้นซึ่งบอกถึงสัญญาณซื้อ","The parabolic SAR is calculated almost independently for each trend in the price. When the price is in an uptrend, the SAR emerges below the price and converges upwards towards it. Similarly, on a downtrend, the SAR emerges above the price and converges downwards. At each step within a trend, the SAR is calculated one period in advance.":"Parabolic SAR คำนวณได้เกือบอิสระสำหรับแต่ละแนวโน้มราคา เมื่อราคาอยู่ในแนวโน้มขาขึ้น SAR จะโผล่ออกมาด้านล่างราคาและลู่ไปทิศทางเดียวกัน ในทำนองเดียวกัน ในช่วงขาลง SAR จะโผล่ขึ้นมาเหนือราคาและลู่ไปทิศทางเดียวกัน ในแต่ละขั้นตอนภายในแนวโน้ม SAR จะคำนวณล่วงหน้าหนึ่งช่วงเวลา","The Price Rate-of-Change (ROC) indicator displays the difference between the current price and the price x-time periods ago. The difference can be displayed in either points or as a percentage.":"ตัวบ่งชี้ Price Rate-of-Change (ROC) แสดงความแตกต่างระหว่างราคาปัจจุบันกับราคา ณ ช่วงเวลาใดเวลาหนึ่งที่ผ่านมา ซึ่งแสดงผลในรูปของจุดหรือร้อยละ","The Rainbow Moving Average (RMA) displays several moving average lines simultaneously. When the lines intersect, it’s an indicator of price reversal and the angle of the lines are helpful to predict the trend strength. The steeper the curve, the stronger the trend. When the price crosses the moving average lines from below, it signals an upward trend. When the price crosses the moving average lines from above, it signals a downward trend. The RMA is easier to use compared to using several different moving average indicators at once.":"Rainbow Moving Average (RMA) แสดงเส้นค่าเฉลี่ยเคลื่อนที่หลายเส้นพร้อมกัน เมื่อเส้นตัดกันจะเป็นตัวบ่งชี้การกลับตัวของราคา และมุมของเส้นจะใช้เป็นการคาดการณ์ความแข็งแกร่งของแนวโน้ม เส้นโค้งที่ชันขึ้นแนวโน้มจะแข็งแกร่งขึ้น เมื่อราคาข้ามเส้นค่าเฉลี่ยเคลื่อนที่จากด้านล่างจะส่งสัญญาณถึงแนวโน้มขาขึ้น เมื่อราคาข้ามเส้นค่าเฉลี่ยเคลื่อนที่จากด้านบนจะส่งสัญญาณถึงแนวโน้มขาลง RMA ใช้งานง่ายเมื่อเทียบกับการใช้ตัวบ่งชี้ค่าเฉลี่ยเคลื่อนที่หลายตัวพร้อมกัน","The Relative Strength Index (RSI) was published by J. Welles Wilder. The current price is normalized as a percentage between 0 and 100. The name of this oscillator is misleading because it does not compare the instrument relative to another instrument or set of instruments, but rather represents the current price relative to other recent pieces within the selected lookback window length.":"Relative Strength Index (RSI) ถูกเผยแพร่โดย J. Welles Wilder ราคาปัจจุบันถูกปรับให้เป็นร้อยละที่มีค่าระหว่าง 0 ถึง 100 ชื่อนี้ทำให้เข้าใจผิด เพราะไม่ได้เป็นการเปรียบเทียบเครื่องมือหนึ่งกับอีกเครื่องมือหนึ่ง หรือ กลุ่มของเครื่องมือที่ใช้ แต่เป็นการแสดงราคาปัจจุบันสัมพันธ์กับราคาอื่นๆ ในช่วงเวลาที่เลือกไว้เปรียบเทียบ","The Stochastic Momentum Index (SMI) helps to identify overbought or oversold conditions in the market and to predict bearish or bullish trends. It calculates the distance between the current closing price and the median of the high/low range, and displays 2 lines on the chart: the first (known as %K) represents the price movement while the second (known as %D) is a moving average of the first line. If the closing price is higher than the median of the high/low range, the SMI returns a positive value. If the closing price is lower than the average price, a negative value is returned. Values above 40 indicate a bullish trend while values below -40 indicate a bearish trend.":"Stochastic Momentum Index (SMI) ช่วยในการระบุสภาวะการซื้อมากเกินไปหรือภาวะขายเกินในตลาดและการคาดการณ์แนวโน้มขาลงหรือขาขึ้น จะคำนวณระยะห่างระหว่างราคาปิดปัจจุบันและค่ามัธยฐานของช่วงสูง/ต่ำและแสดง 2 เส้นบนแผนภูมิเส้นแรก (เรียกว่า %K) แสดงถึงการเคลื่อนไหวของราคาในขณะที่เส้นที่สอง (เรียกว่า %D) คือ a ค่าเฉลี่ยเคลื่อนที่ของบรรทัดแรก หากราคาปิดสูงกว่าค่ากลางของช่วงสูง/ต่ำ SMI จะส่งกลับค่าเป็นบวก หากราคาปิดต่ำกว่าราคาเฉลี่ยระบบจะส่งคืนค่าลบ ค่าที่สูงกว่า 40 หมายถึงแนวโน้มที่เป็นขาขึ้นในขณะที่ค่าที่ต่ำกว่า -40 แสดงถึงแนวโน้มขาลง","Themes":"ธีม","There are no favorites yet.":"ยังไม่มีรายการโปรด","tick":"tick","Tick interval only available for \\\\\\"Area\\\\\\" Chart type.":"ช่วง tick เท่านั้นที่สามารถใช้ได้เฉพาะกับ \\\\\\"พื้นที่\\\\\\" แบบแผนภูมิ","Time interval":"ช่วงเวลา","Trend":"","Trend [num]":"แนวโน้ม [num]","Try checking your spelling or use a different term":"ลองตรวจสอบการสะกดของคุณหรือใช้คำอื่น","Underlying Assets":"ผลิตภัณฑ์อ้างอิง","Up to 2 active indicators allowed.":"","Up to 5 active indicators allowed.":"เลือกได้สูงสุด 5 ดัชนี","Vertical [num]":"แนวตั้ง [num]","Volatility":"","Would you like to overwrite it?":"ท่านต้องการเขียนทับหรือไม่?","You have no active drawings yet.":"คุณยังไม่มีภาพวาดที่ใช้งานอยู่","You have no active indicators yet.":"คุณยังไม่มีตัวบ่งชี้ที่ใช้งานอยู่","You have no saved templates yet.":"คุณยังไม่มีเทมเพลตที่บันทึกไว้","Zig Zag helps to identify trend reversals and filters out relatively small price movements by determining the support and resistance levels of the market. It accepts a percentage of deviation as the input and displays a line if the price change is larger than the percentage of deviation. Zig Zag ignores any sideways movement and is useful to filter out “market noise”.":"Zig Zag ช่วยระบุการกลับตัวของแนวโน้ม และกรองการเคลื่อนไหวของราคาที่ค่อนข้างเล็กโดยการกำหนดแนวรับและแนวต้านของตลาด ซึ่งยอมรับเปอร์เซ็นต์ของค่าเบี่ยงเบนเป็นข้อมูลเข้า และแสดงบรรทัดหากการเปลี่ยนแปลงของราคามีค่ามากกว่าเปอร์เซ็นต์ของส่วนเบี่ยงเบน Zig Zag ไม่สนใจการเคลื่อนไหวด้านข้างและมีประโยชน์ในการกรอง \\"สัญญาณรบกวนของตลาด\\"","Zoom in":"ย่อลง","Zoom out":"ขยายออก"}')}}]);
